description:
Karina White is over at her girlfriend's house and finds her brother Xander rocking out air guitar-style in his room. She tells him she used to think he was cute when they were younger, but now he's jobless and irresponsible, betting on his pipe-dream band. She notices his big boner in his pants, and when he pulls it out, she notices it in her mouth! Girls just wanna have fun...

